package com.tiantian.springintejms.utils;

import com.sun.org.apache.xerces.internal.impl.dv.util.Base64;
import org.opencv.core.*;
import org.opencv.highgui.Highgui;

/**
 * Created by AndrewKing on 10/15/2018.
 */

public class opencvTest{
    static{
//        System.loadLibrary(Core.NATIVE_LIBRARY_NAME);
        System.load(OpencvUtils.dllPath);
    }

    public static void main(String[] args) {
        System.out.println("Welcome to OpenCV " + Core.VERSION);
        Mat m = new Mat(5, 10, CvType.CV_8UC1, new Scalar(0));
        System.out.println("OpenCV Mat: " + m);
        Mat mr1 = m.row(1);
        mr1.setTo(new Scalar(1));
        Mat mc5 = m.col(5);
        mc5.setTo(new Scalar(5));
        System.out.println("OpenCV Mat data:\n" + m.dump());

        //圆心
        Point center = new Point(255, 255);
        //半径
        int r = 100;
        //承载图像
        Mat picture = new Mat(500, 500, CvType.CV_8UC3, new Scalar(255, 255, 255));
        //参数为：承载的图像、圆心、半径、颜色、粗细、线型
        Core.circle(picture, center, r, new Scalar(0, 0, 0));
//        Highgui.imwrite("H://11.png", picture);

        System.out.println("height: " + picture.height());
        System.out.println("width: " + picture.width());

        String dataString = "data:image/jpg;base64,";
        byte[] data = Base64.decode(dataString.split(",")[1]);
        Mat mat = Highgui.imdecode(new MatOfByte(data), Highgui.CV_LOAD_IMAGE_UNCHANGED);
        Highgui.imwrite("H://77.png", mat);

        Mat imageTest = Highgui.imread("H://77.png");
        String sBase64 = OpencvUtils.MatToBase64(imageTest);
    }
}